            </thead>
            <tbody>
                {brands.map((brand) => (
                    <tr key={brand._id}>
                        <td>{brand.name}</td>
                        <td>
                            <button className="edit-btn" onClick={() => onEdit(brand)}>‚úèÔ∏è Edit</button>
                            <button className="delete-btn" onClick={() => onDelete(brand._id)}>üóëÔ∏è Delete</button>
                        </td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default BrandList;
